import './App.css';
import Request from "./components/Request";
import React, {useState} from "react";
import axios from "axios";

function App() {

    const [getAllCourses, setGetAllCourses] = useState([])
    axios.get('http://localhost:8081/getAllCourses')
        .then(res => {
            setGetAllCourses(res.data)
        });
    return (<div>
            {getAllCourses.map(eachCourse => <div>
                <p>{eachCourse.deptName}</p>
                <a href="https://www.w3schools.com">{eachCourse.crawledCourses.degreeName}</a>

                <p></p>
            </div>)}
        </div>
    );

}

export default App;
